CREATE TABLE INGREDIENT_TRANSLATION_ALL
(
   INGREDIENT       VARCHAR2(255 Byte),
   INGREDIENT_CODE  VARCHAR2(255 Byte),
   TRANSLATION      VARCHAR2(255 Byte)
)
TABLESPACE USERS;

WbImport -file=C:/Users/aostropolets/Desktop/Germany/ingredient_translation.txt
         -type=text
         -table=INGREDIENT_TRANSLATION_ALL
         -encoding="ISO-8859-15"
         -header=true
         -decode=false
         -dateFormat=dd/m/yyyy
         -timestampFormat=dd/m/yyyy
         -delimiter='\t'
         -decimal=.
         -fileColumns=INGREDIENT_CODE,INGREDIENT,TRANSLATION
         -quoteCharEscaping=none
         -ignoreIdentityColumns=false
         -deleteTarget=false
         -continueOnError=false
         -batchSize=500;
         

